import React from 'react';
import './Hero.css';

function Hero() {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>Find Skilled Freelancers for Your Projects</h1>
        <p>Connecting clients with talented service providers across various sectors.</p>
        <div className="cta-buttons">
          <button className="cta-client">I'm a Client</button>
          <button className="cta-provider">I'm a Service Provider</button>
        </div>
      </div>
    </section>
  );
}

export default Hero;
